import React from 'react';

 class API extends React.Component{
     render(){
         return(
             <div>
                <form onSubmit={this.props.listSale}>
                    <input type="text" name="city" placeholder="city" />
                    <button >Get a House</button>
                </form>
                {this.props.data.map((data, index) => (
                        <div key={index}
                        ref={el => this.wordsRef[index] = el}
                        > 
                            <div>
                                {data.city}
                            </div>
                            <div>
                                {data.line}
                            </div>
                            <div>
                                {data.baths}
                            </div>
                        </div>
                    ))}
                
             </div>
         )
     }
 }

export default API;
